import noAvatar from '../assets/no-avatar.png'
import heart from '../assets/heart-gui.png'

function User() {
    return (
        <div className="user">
            <img class="health" src={noAvatar}></img>
            <span className="name" dir="auto">{this.props.message.name} </span>

        </div>
    )
}

export default User
